import React from 'react';
import InstagramIcon from '@mui/icons-material/Instagram';

function Footer() {
  return (
    <div className="footer">
        <div className="socialMedia"></div>
        <p>&copy; 2022 jackspizza.com by Sam Page</p>
    </div>
  )
}

export default Footer;
